import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import Box from '@mui/material/Box'

const UserInfoCard = () => {
    const stringAvatar=(name)=> {
        return {
          children: `${name.split('.')[0][0]} ${name.split(' ')[1][0]}`,
        };
      }

    return (
        <Box component='div' sx={{
            width: 210,
            height: 70,
            backgroundColor: 'primary.main',
            borderRadius: '8px',
        }}>
            <Box sx={{ px: 16, py: 19, display: 'flex' }} >
                <Avatar >
                    R
                </Avatar>

                <Box sx={{ml : 12, overflow: 'hidden', textOverflow: 'ellipsis', whiteSpace: 'nowrap'}}>
                  <Box sx={{fontWeight : 'bold', fontSize : '14px'}}> Leo.moon </Box>
                  <Box sx={{fontSize : '12px'}}> 영업팀 </Box>
                </Box>

                <Box sx={{display: 'float:right'}}>
                    <IconButton aria-label="settings">
                        <MoreVertIcon />
                    </IconButton>
                </Box>
             


            </Box>
        </Box>
        // <Paper>

        // </Paper>
        // <Card variant="outlined">

        //     <CardHeader
        //         avatar={
        //             <Avatar  aria-label="recipe">
        //                 R
        //             </Avatar>
        //         }
        //         action={
        //             <IconButton aria-label="settings">
        //                 <MoreVertIcon />
        //             </IconButton>
        //         }
        //         title="Leo.moon"
        //         subheader="영업팀" />
        // </Card>
    );
}


export default UserInfoCard;
